class Solution {
    fun lastVisitedIntegers(words: List<String>): List<Int> {
        val result = mutableListOf<Int>()
        val visitedIntegers = mutableListOf<Int>()
        var consecutivePrevCount = 0

        for (word in words) {
            if (word == "prev") {
                consecutivePrevCount++
                if (consecutivePrevCount > visitedIntegers.size) {
                    result.add(-1)
                } else {
                    result.add(visitedIntegers[visitedIntegers.size - consecutivePrevCount])
                }
            } else {
                visitedIntegers.add(word.toInt())
                consecutivePrevCount = 0
            }
        }

        return result
    }
}
